column11:
Handlebar is another great coffee location in downtown Santa Barbara and is a favorite for many bikers. I loved the hip and earthy vibe of the place complete with funky fonts and a giant coffee roaster.

// SERVICE // The woman (who I believe may be the owner) was incredibly sweet, welcoming, and informative. She told me the store makes their own vanilla and chocolate syrup to flavor the coffees. The employees are much more welcoming and warm than those at the French Press.

// FOOD // 
     + Vanilla latte: I asked her to only put a tiny bit of vanilla into the latte which she happily obliged. The latte was very hot and the hint of vanilla was very fragrant and lightly sweetened the drink.
     + Cappuccino: Complete with pretty foam art! We sweetened it a bit with the cane sugar available. It was bold which was balanced with the foam.
